INSERT INTO `sbc-crm`.`auto_tag_sql`(`id`, `auto_tag_id`, `type`, `sql_str`, `big_data_sql_str`, `del_flag`, `create_person`, `create_time`, `update_person`, `update_time`) VALUES (1, 1, 0, 'SELECT 1 AS tagId, \'终端偏好\' as tagName, \'0\' as tagType, 0 as type, resAll.customer_id, \'TERMINAL_SOURCE\' as dimensionType, resAll.result as dimensionId, resAll.total as num FROM (SELECT @rankNum := IF( @customerId = res.customer_id, @rankNum + 1, 1 ) as rankNum, @customerId := res.customer_id as customer_id, res.total, res.result FROM ( SELECT customer_id, count(b.terminal_source) as total, b.terminal_source as result, max(b.create_time) as last_time FROM customer_follow b  where b.create_time >= date_format(date_sub(NOW(), interval 60 day), \'%Y-%m-%d\') and b.create_time <= date_format(NOW(), \'%Y-%m-%d\')  and b.terminal_source is not null GROUP BY b.customer_id, b.terminal_source ORDER BY b.customer_id ) res,( SELECT @customerId := \'\', @rankNum := 0 ) rank ORDER BY res.customer_id, res.total DESC ) resAll WHERE resAll.rankNum <= 1', 'SELECT 1 AS tagId, \'终端偏好\' as tagName, \'0\' as tagType, 0 as type, resAll.customer_id, \'TERMINAL_SOURCE\' as dimensionType, resAll.result as dimensionId, resAll.total as num, ${date} FROM (SELECT row_number() over (partition by res.customer_id order by res.total desc, res.last_time desc ) rankNum, res.* FROM ( SELECT customer_id, count(b.terminal_source) as total, b.terminal_source as result, max(b.create_time) as last_time FROM customer_follow b  where b.p_date >= date_format(date_sub(date_format(CURRENT_TIMESTAMP,\'yyyy-MM-dd HH:mm:ss\'),  60 ), \'yyyy-MM-dd\') and b.p_date <= date_format(date_format(CURRENT_TIMESTAMP,\'yyyy-MM-dd HH:mm:ss\'), \'yyyy-MM-dd\')  and b.terminal_source is not null GROUP BY b.customer_id, b.terminal_source ORDER BY b.customer_id ) res ) resAll WHERE resAll.rankNum <= 1', 0, NULL, NULL, NULL, NULL);
INSERT INTO `sbc-crm`.`auto_tag_sql`(`id`, `auto_tag_id`, `type`, `sql_str`, `big_data_sql_str`, `del_flag`, `create_person`, `create_time`, `update_person`, `update_time`) VALUES (2, 2, 0, 'SELECT 2 AS tagId, \'类目偏好\' as tagName, \'0\' as tagType, 4 as type, resAll.customer_id, \'CATE_TOP_ID\' as dimensionType, resAll.result as dimensionId, resAll.total as num FROM (SELECT @rankNum := IF( @customerId = res.customer_id, @rankNum + 1, 1 ) as rankNum, @customerId := res.customer_id as customer_id, res.total, res.result FROM ( SELECT a.customer_id, count(b.cate_top_id) as total, b.cate_top_id as result, max(a.create_time) as last_time FROM trade a LEFT JOIN trade_item b on a.tid = b.tid where a.create_time >= date_format(date_sub(NOW(), interval 180 day), \'%Y-%m-%d\') and a.create_time <= date_format(NOW(), \'%Y-%m-%d\') and a.pay_state = 2  and b.cate_top_id is not null GROUP BY a.customer_id, b.cate_top_id ORDER BY a.customer_id ) res,( SELECT @customerId := \'\', @rankNum := 0 ) rank ORDER BY res.customer_id, res.total DESC ) resAll WHERE resAll.rankNum <= 3', 'SELECT 2 AS tagId, \'类目偏好\' as tagName, \'0\' as tagType, 4 as type, resAll.customer_id, \'CATE_TOP_ID\' as dimensionType, resAll.result as dimensionId, resAll.total as num, ${date} FROM (SELECT row_number() over (partition by res.customer_id order by res.total desc, res.last_time desc ) rankNum, res.* FROM ( SELECT a.customer_id, count(b.cate_top_id) as total, b.cate_top_id as result, max(a.create_time) as last_time FROM trade a LEFT JOIN trade_item b on a.tid = b.tid where a.p_date >= date_format(date_sub(date_format(CURRENT_TIMESTAMP,\'yyyy-MM-dd HH:mm:ss\'),  180 ), \'yyyy-MM-dd\') and a.p_date <= date_format(date_format(CURRENT_TIMESTAMP,\'yyyy-MM-dd HH:mm:ss\'), \'yyyy-MM-dd\') and a.pay_state = 2  and b.cate_top_id is not null GROUP BY a.customer_id, b.cate_top_id ORDER BY a.customer_id ) res ) resAll WHERE resAll.rankNum <= 3', 0, NULL, NULL, NULL, NULL);
