INSERT INTO `sbc-crm`.`auto_tag_sql`(`id`, `auto_tag_id`, `type`, `sql_str`, `big_data_sql_str`, `del_flag`, `create_person`, `create_time`, `update_person`, `update_time`) VALUES (10, 10, 0, 'SELECT 10 AS tagId, \'消费日偏好\' as tagName, \'0\' as tagType, 4 as type, resAll.customer_id, \'DATE\' as dimensionType, resAll.result as dimensionId, resAll.total as num FROM (SELECT @rankNum := IF( @customerId = res.customer_id, @rankNum + 1, 1 ) as rankNum, @customerId := res.customer_id as customer_id, res.total, res.result FROM ( SELECT a.customer_id, count(WEEKDAY(a.create_time)) as total, WEEKDAY(a.create_time) as result, max(a.create_time) as last_time FROM trade a LEFT JOIN trade_item b on a.tid = b.tid where a.create_time >= date_format(date_sub(NOW(), interval 60 day), \'%Y-%m-%d\') and a.create_time <= date_format(NOW(), \'%Y-%m-%d\') and a.pay_state = 2  and a.create_time is not null GROUP BY a.customer_id, WEEKDAY(a.create_time) ORDER BY a.customer_id ) res,( SELECT @customerId := \'\', @rankNum := 0 ) rank ORDER BY res.customer_id, res.total DESC ) resAll WHERE resAll.rankNum <= 3', 'SELECT 10 AS tagId, \'消费日偏好\' as tagName, \'0\' as tagType, 4 as type, resAll.customer_id, \'DATE\' as dimensionType, resAll.result as dimensionId, resAll.total as num, ${date} FROM (SELECT row_number() over (partition by res.customer_id order by res.total desc, res.last_time desc ) rankNum, res.* FROM ( SELECT a.customer_id, count(pmod(datediff(a.create_time,\'2018-01-01\'),7)) as total, pmod(datediff(a.create_time,\'2018-01-01\'),7) as result, max(a.create_time) as last_time FROM trade a LEFT JOIN trade_item b on a.tid = b.tid where a.p_date >= date_format(date_sub(date_format(CURRENT_TIMESTAMP,\'yyyy-MM-dd HH:mm:ss\'),  60 ), \'yyyy-MM-dd\') and a.p_date <= date_format(date_format(CURRENT_TIMESTAMP,\'yyyy-MM-dd HH:mm:ss\'), \'yyyy-MM-dd\') and a.pay_state = 2  and a.create_time is not null GROUP BY a.customer_id, pmod(datediff(a.create_time,\'2018-01-01\'),7) ORDER BY a.customer_id ) res ) resAll WHERE resAll.rankNum <= 3', 0, NULL, NULL, NULL, NULL);
