-- 自定义人群增加自动标签字段 --
ALTER TABLE `sbc-crm`.`custom_group`
ADD COLUMN `preference_tags` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '偏好标签，拼接方式为偏好标签组id-标签id，多选以逗号分隔' AFTER `customer_tags`,
ADD COLUMN `auto_tags` varchar(2000) NULL COMMENT '指标值范围标签和综合标签' AFTER `preference_tags`,
DROP PRIMARY KEY,
ADD PRIMARY KEY (`id`) USING BTREE;
-- 自定义人群增加自动标签字段end --
CREATE TABLE `sbc-crm`.`auto_tag` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `tag_name` varchar(255) NOT NULL COMMENT '自动标签名称',
  `customer_count` bigint(11) DEFAULT '0' COMMENT '会员人数',
  `type` tinyint(4) NOT NULL COMMENT '标签类型，0：偏好标签组，1：指标值标签，2：指标值范围标签，3、综合类标签',
  `day` int(10) DEFAULT NULL COMMENT '规则天数',
  `relation_type` tinyint(4) DEFAULT NULL COMMENT '一级维度且或关系，0：且，1：或',
  `system_tag_id` bigint(20) DEFAULT NULL COMMENT '系统标签ID',
  `rule_json` longtext COMMENT '规则json内容',
  `rule_json_sql` longtext COMMENT '供SQL分析的规则json内容',
  `system_flag` tinyint(4) NOT NULL COMMENT '系统标识 0:非系统 1:系统',
  `del_flag` tinyint(4) DEFAULT '0' COMMENT '删除标识，0：未删除，1：已删除',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_person` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `update_person` varchar(50) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=109 DEFAULT CHARSET=utf8 COMMENT='自动标签表';

CREATE TABLE `sbc-crm`.`auto_tag_customer_tag` (
  `tag_id` bigint(20) DEFAULT NULL COMMENT '标签id',
  `tag_type` tinyint(4) NOT NULL COMMENT '标签类型，0：偏好标签组，1：指标值标签，2：指标值范围标签，3、综合类标签',
  `customer_id` varchar(50) DEFAULT NULL COMMENT '会员id',
  `p_date` date DEFAULT NULL COMMENT '时间',
  KEY `index_customer_id` (`customer_id`),
  KEY `index_p_date` (`p_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员对应的标签';

CREATE TABLE `sbc-crm`.`auto_tag_init` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `tag_name` varchar(255) NOT NULL COMMENT '自动标签名称',
  `type` tinyint(4) NOT NULL COMMENT '标签类型，0：偏好标签组，1：指标值标签，2：指标值范围标签，3、综合类标签',
  `day` int(10) DEFAULT NULL COMMENT '规则天数',
  `relation_type` tinyint(4) DEFAULT NULL COMMENT '一级维度且或关系，0：且，1：或',
  `rule_json` text COMMENT '规则json内容',
  `rule_json_sql` text COMMENT '供SQL分析的规则json内容',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='自动标签表';

CREATE TABLE `sbc-crm`.`auto_tag_preference_statistics` (
  `tag_id` bigint(20) DEFAULT NULL COMMENT '标签id',
  `dimension_type` varchar(100) DEFAULT NULL COMMENT '维度类型',
  `dimension_id` varchar(40) DEFAULT NULL COMMENT '维度id',
  `num` int(11) DEFAULT NULL COMMENT '数量统计',
  `p_date` date DEFAULT NULL COMMENT '时间',
  KEY `index_tag_id` (`tag_id`),
  KEY `index_p_date` (`p_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='偏好类标签统计';

CREATE TABLE `sbc-crm`.`auto_tag_last_date` (
  `type_id` varchar(50) NOT NULL COMMENT '0:auto_tag_customer_tag;1:auto_tag_customer_preference_statistics;2:auto_tag_statistics',
  `last_date` date DEFAULT NULL COMMENT '最后更新数据的日期，使用该日期去查询',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`type_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='大数据推送数据的最后有效时间';

CREATE TABLE `sbc-crm`.`auto_tag_sql` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `auto_tag_id` bigint(20) DEFAULT NULL COMMENT '自动标签表ID',
  `type` tinyint(4) DEFAULT NULL COMMENT '''标签类型，0：偏好标签组，1：指标值标签，2：指标值范围标签，3、综合类标签''',
  `sql_str` longtext COMMENT 'SQL语句',
  `big_data_sql_str` longtext COMMENT '大数据sql',
  `del_flag` tinyint(4) DEFAULT NULL COMMENT '删除标识 0:未删除 1:已删除',
  `create_person` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_person` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4 COMMENT='自动标签sql';

CREATE TABLE `sbc-crm`.`auto_tag_statistics` (
  `tag_id` bigint(20) DEFAULT NULL COMMENT '标签id',
  `tag_type` tinyint(4) DEFAULT NULL COMMENT '标签类型，0：偏好标签组，1：指标值标签，2：指标值范围标签，3、综合类标签',
  `num` bigint(20) DEFAULT NULL COMMENT '人数',
  `p_date` date DEFAULT NULL COMMENT '时间',
  KEY `index_p_date` (`p_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `sbc-crm`.`spark_submit_info` (
  `config` text,
  `jobName` varchar(255) NOT NULL,
  `jobId` bigint(20) NOT NULL COMMENT 'spark提交任务信息表',
  `submit_way` varchar(255) NOT NULL COMMENT '提交方式:livy或者自定义的类',
  `jobType` varchar(255) DEFAULT NULL COMMENT '是jar包形式还是代码形式',
  PRIMARY KEY (`jobId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `sbc-crm`.`tag_dimension` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '维度名',
  `dimension_enum` tinyint(4) DEFAULT NULL COMMENT 'DimensionName枚举下标',
  `table_name` varchar(255) DEFAULT NULL COMMENT '维度对应表明',
  `first_last_type` tinyint(4) DEFAULT '0' COMMENT '0: 非首末 1首次 2末次',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COMMENT='标签维度表';

CREATE TABLE `sbc-crm`.`tag_dimension_setting` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `tag_id` bigint(11) DEFAULT NULL COMMENT '标签id',
  `tag_dimension_id` bigint(11) DEFAULT NULL COMMENT '标签维度id',
  `relation_type` tinyint(4) DEFAULT NULL COMMENT '条件类型，0：且，1：或',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='标签维度配置表';

CREATE TABLE `sbc-crm`.`tag_param` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `tag_dimension_id` bigint(11) DEFAULT NULL COMMENT '标签维度id',
  `name` varchar(255) DEFAULT NULL COMMENT '维度配置名称',
  `column_name` varchar(255) DEFAULT NULL COMMENT '字段名称',
  `type` tinyint(4) DEFAULT NULL COMMENT '维度配置类型，0：top类型，1：结果类型，2：查询条件类型',
  `tag_dimension_type` tinyint(4) DEFAULT NULL COMMENT '标签维度类型，0：top类型，1：count计数类型，2：sum求和，3：avg平均值，4：max最大值，5：min最小值，6：in包含类型，7：等于，8、区间类，9：多重期间or关系',
  `tag_type` tinyint(4) DEFAULT NULL COMMENT '标签参数类型 1:指标值参数',
  `column_type` tinyint(4) DEFAULT '0' COMMENT '0 input输入框 1范围输入框 2下拉选择框',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=643 DEFAULT CHARSET=utf8 COMMENT='标签参数表';

CREATE TABLE `sbc-crm`.`tag_param_init` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '维度配置名称',
  `column_name` varchar(255) DEFAULT NULL COMMENT '字段名称',
  `type` tinyint(4) DEFAULT NULL COMMENT '维度配置类型，0：top类型，1：聚合结果类型，2：查询条件类型',
  `tag_dimension_type` tinyint(4) DEFAULT NULL COMMENT '标签维度类型，0：top类型，1：count计数类型，2：sum求和，3：avg平均值，4：max最大值，5：min最小值，6：in包含类型，7：等于，8、区间类，9：多重期间or关系',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='标签参数表';

CREATE TABLE `sbc-crm`.`tag_param_value` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `tag_id` bigint(11) DEFAULT NULL COMMENT '标签id',
  `tag_param_id` bigint(11) DEFAULT NULL COMMENT '标签条件id',
  `tag_param_value` text COMMENT '条件值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='标签参数值表';

CREATE TABLE `sbc-crm`.`sqoop_job_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sqoop_name` varchar(255) DEFAULT NULL COMMENT '任务名称',
  `job_id` varchar(100) DEFAULT NULL COMMENT 'jobid',
  `appliaction_id` varchar(100) DEFAULT NULL COMMENT 'yarn application id',
  `state` varchar(50) DEFAULT NULL COMMENT '执行状态',
  `start_time` bigint(20) DEFAULT NULL COMMENT '开始时间',
  `end_time` bigint(20) DEFAULT NULL COMMENT '结束时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建记录时间',
  `date` date DEFAULT NULL COMMENT '统计日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='sqoop执行记录表';

CREATE TABLE `sbc-crm`.`preference_tag_detail` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `tag_id` bigint(11) DEFAULT NULL COMMENT '标签id',
  `detail_name` varchar(255) DEFAULT NULL COMMENT '偏好类标签名称',
  `customer_count` bigint(11) DEFAULT '0' COMMENT '会员人数',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='偏好类标签表';

